/**
 * 公路中心关系图组件
 * @param {数据} = [data] 
 * @param {容器id,class} = [eleRoot:元素唯一标识]
 */
function jsGraphRule(eleRoot) {
	this.ele = document.querySelector(eleRoot);
	if (!eleRoot || !this.ele) return false;
	//数据处理
	this.links = [];
	this.coords = [];
	//获取中位数
	this.middle = (len) => {
		if (len % 2 === 0) { //判断数字个数是奇数还是偶数
			return (len / 2 + (len / 2 - 1)) / 2; //偶数个取中间两个数的平均数
		} else {
			return parseInt(len / 2); //奇数个取最中间那个数
		}
	}
	//设置样式
	this.setStyle = (style) => {
		this.style = { 
			//图片
			img: {
				//节点背景图
				itemImg: style.img.itemImg ? style.img.itemImg : 'data:image/png;base64,',
				//组件背景图(中心图)
				centerImg: style.img.centerImg ? style.img.centerImg : 'data:image/png;base64,',
			},
			//中间元素
			center: {
				//文字颜色
				color: style.center.color ? style.center.color : "#fff",
				//文字类型
				fontStyle: style.center.fontStyle ? style.center.fontStyle : 'normal',
				//文字粗细
				fontWeight: style.center.fontWeight ? style.center.fontWeight : 700,
				//字体
				fontFamily: style.center.fontFamily ? style.center.fontFamily : 'MicrosoftYaHei',
				//文字大小
				fontSize: style.center.fontSize ? style.center.fontSize : 35,
				//横向对齐
				align: style.center.align ? style.center.align : 'center',
				//纵向对齐
				verticalAlign: style.center.verticalAlign ? style.center.verticalAlign : 'middle',
				//宽度
				width: style.center.width ? style.center.width : 238,
				//高度
				height: style.center.height ? style.center.height : 98,
				//左右上下间距
				padding: style.center.padding ? style.center.padding : [0, 0, 0, 0]
				//其他暂未开放配置
			},
			//节点标题样式
			title: {
				color: style.title.color ? style.title.color : "#03D3FB",
				fontStyle: style.title.fontStyle ? style.title.fontStyle : 'normal',
				fontWeight: style.title.fontWeight ? style.title.fontWeight : 100,
				fontFamily: style.title.fontFamily ? style.title.fontFamily : 'MicrosoftYaHei',
				fontSize: style.title.fontSize ? style.title.fontSize : 18,
				align: style.title.align ? style.title.align : 'center',
				padding: style.title.padding ? style.title.padding : [18, 0, 0, 0],
			},
			//节点数字样式
			num: {
				color: style.num.color ? style.num.color : "#fff",
				fontStyle: style.num.fontStyle ? style.num.fontStyle : 'normal',
				fontWeight: style.num.fontWeight ? style.num.fontWeight : 100,
				fontFamily: style.num.fontFamily ? style.num.fontFamily : 'MicrosoftYaHei',
				fontSize: style.num.fontSize ? style.num.fontSize : 18,
				padding: style.num.padding ? style.num.padding : [5, 0, 0, 0],
			},
			//节点单位样式
			unit: {
				color: style.unit.color ? style.unit.color : "#AFC6DD",
				fontStyle: style.unit.fontStyle ? style.unit.fontStyle : 'normal',
				fontWeight: style.unit.fontWeight ? style.unit.fontWeight : 100,
				fontFamily: style.unit.fontFamily ? style.unit.fontFamily : 'MicrosoftYaHei',
				fontSize: style.unit.fontSize ? style.unit.fontSize : 14,
				padding: style.unit.padding ? style.unit.padding : [5, 0, 0, 0],
			},
			//节点下文本样式
			text: {
				color: style.text.color ? style.text.color : "#0673C3",
				fontStyle: style.text.fontStyle ? style.text.fontStyle : 'normal',
				fontWeight: style.text.fontWeight ? style.text.fontWeight : 100,
				fontFamily: style.text.fontFamily ? style.text.fontFamily : 'MicrosoftYaHei',
				fontSize: style.text.fontSize ? style.text.fontSize : 14,
				padding: style.text.padding ? style.text.padding : [5, 0, 0, 0],
			},
			//线效果
			lineStyle: {
				//连接线颜色
				color: style.lineStyle.color ? style.lineStyle.color : '#fff',
				//连接线类型
				type: style.lineStyle.type ? style.lineStyle.type : 'dashed',
				//线宽
				width: style.lineStyle.width ? style.lineStyle.width : 1,
			},
			//光点效果
			effect: {
				//是否展示光点效果
				show: style.effect.show ? style.effect.show : true,
				//运行耗时(动画时长)
				period: style.effect.period ? style.effect.period : 5,
				//轨迹线、拖尾
				trailLength: style.effect.trailLength ? style.effect.trailLength : 0.01, //
				//光点大小
				symbolSize: style.effect.symbolSize ? style.effect.symbolSize : 18,
				//形状
				symbol: style.effect.symbol ? style.effect.symbol : "pin",
				//动画是否循环
				loop: style.effect.loop ? style.effect.loop : true,
				//光点颜色
				color: style.effect.color ? style.effect.color : "#fff"
			},
			//子节点大小
			label: {
				//节点宽度
				width: style.label.width ? style.label.width : 238,
				//节点高度
				height: style.label.height ? style.label.height : 97,
			}
		};
	};
	//整理数据
	this.setData = (data) => {
		//获取容器大小
		let width = this.ele.offsetWidth;
		let height = this.ele.offsetHeight;
		let data_left_len = data.left.length;
		let data_right_len = data.right.length;
		let left_margin = (height / (data.left.length));
		let right_margin = (height / (data.right.length));
		//获取中位数
		let middle_left = this.middle(data.left);
		let middle_right = this.middle(data.right);
		this.xAxisMax = width;
		this.yAxisMax = height;
		//整合数据
		data.center.x = width / 2;
		data.center.y = height / 2;
		data.center.value = [data.center.x, data.center.y];
		data.center.label = {
			show: true,
			width: this.style.center.width,
			height: this.style.center.height,
			backgroundColor: {
				image: 'none'
			},
			offset: [0, 0],
			padding: [0, 0, 0, 0],
			position: 'inside',
			formatter: [
				'{a| {b} }',
			].join('\n'),
			rich: {
				a: this.style.center,
			}
		};
		this.dataOpt = [data.center];
		if (data.left && data.left.length > 0) {
			data.left.forEach((left, index) => {
				left.x = this.style.label.width;
				left.y = left_margin * (index+0.5);
				left.value = [left.x, left.y];
				left.label = {
					offset: [-(this.style.label.width / 2), 0]
				};
				if (index < this.middle(data_left_len)) {
					left.lineStyle = {
						curveness: 0.15,
					}
				} else if (index > this.middle(data_left_len)) {
					left.lineStyle = {
						curveness: '-0.15',
					}
				} else {
					left.lineStyle = {
						curveness: 0,
					}
				}
				let o = {
					source: data.center.name,
					target: left.name,
					lineStyle: left.lineStyle
				};
				let coord = {
					coords: [
						[left.x, left.y],
						[data.center.x - this.style.center.width / 2, data.center.y],
					],
					lineStyle: left.lineStyle
				};
				this.links.push(o);
				this.coords.push(coord);
				this.dataOpt.push(left);
			});
		}
		if (data.right && data.right.length > 0) {
			data.right.forEach((right, index) => {
				right.x = width - this.style.label.width / 2;
				right.y = right_margin * (index+0.5);
				right.value = [right.x, right.y];
				right.label = {
					offset: [0, 0]
				};
				if (index < this.middle(data_right_len)) {
					right.lineStyle = {
						curveness: 0.15,
					}
				} else if (index > this.middle(data_right_len)) {
					right.lineStyle = {
						curveness: '-0.15',
					}
				} else {
					right.lineStyle = {
						curveness: 0,
					}
				}
				let o = {
					source: right.name,
					target: data.center.name,
					lineStyle: right.lineStyle
				};
				let coord = {
					coords: [
						[data.center.x + this.style.center.width / 2, data.center.y],
						[right.x - (this.style.label.width) / 2, right.y]
					],
					lineStyle: right.lineStyle
				};
				this.links.push(o);
				this.coords.push(coord);
				this.dataOpt.push(right);
			});
		}
	};
	this.setOption = () => {
		let data = this.data;
		this.option = {
			grid: {
				left: 0,
				top: 0,
				bottom: 0,
				right: 0,
			},
			xAxis: {
				show: false,
				type: "value",
				min: 0,
				max: this.xAxisMax,
			},
			yAxis: {
				show: false,
				type: "value",
				inverse: true,
				min: 0,
				max: this.yAxisMax,
			},
			series: [{
					type: 'graph',
					draggable: false,
					coordinateSystem: 'cartesian2d', //使用二维的直角坐标系（也称笛卡尔坐标系）
					zlevel: 5,
					symbol: 'rect',
					symbolSize: [1,0],
					symbolOffset: [0, 0],
					roam: false,
					itemStyle:{
						color:'transparent'
					},
					label: {
						show: true,
						width: this.style.label.width,
						height: this.style.label.height,
						backgroundColor: {
							image: this.style.img.itemImg
						},
						align: 'center',
						verticalAlign: 'middle',
						position: 'inside',
						formatter: (params) => {
							return [
								'{a| ' + params.data.name + ' }',
								'{b| ' + params.data.num + ' }' + '{c| ' + params.data
								.unit + ' }',
								'{x| ' + params.data.text + ' }'
							].join('\n');
						},
						rich: {
							a: this.style.title,
							b: this.style.num,
							c: this.style.unit,
							x: this.style.text,
						}
					},
					data: this.dataOpt,
					//links: this.links,
					lineStyle: {
						type: 'dashed'
					}
				},
				{
					type: "lines",
					coordinateSystem: "cartesian2d",
					z: 2,
					zlevel: 2,
					animation: false,
					lineStyle: this.style.lineStyle,
					effect: this.style.effect,
					data: this.coords
				},
			],
		};
	}
	/**
		* 初始化
		* @param {Array}  = [data] 
		*/
	this.init = (data) => {
		if (JSON.stringify(data) == '{}') return;
		if (this.myChart) return;
		//数据赋值
		this.data = data;
		//处理样式数据
		this.setStyle(data.style);
		//图表容器生成
		this.ele.innerHTML = `<div class="jsGraphRule" style="	width: 100%;
			height: 100%;
			box-sizing: content-box;
			background-image: url(${this.style.img.centerImg});
			background-repeat: no-repeat;
			background-position: calc(50%) 50%;
			background-size: auto;"></div>`
		//图形实例
		this.myChart = echarts.init(document.querySelector('.jsGraphRule'));
		this.myChart.showLoading();
		//处理展示数据
		this.setData(this.data);
		//整理为图表所用数据
		this.setOption();
		//图表设置
		this.myChart.setOption(this.option);
		this.myChart.hideLoading();
	};
	/**
		* 重载
		* @param {Array}  = [new data or old data] 
		*/
	this.reload = (data) => {
		if (JSON.stringify(data) == '{}') return;
		this.dispose();
		this.init(data);
	}
	/**
		* 自适应
		*/
	this.resize = () => {
		this.reload(this.data);
	};
	/**
		* 销毁
		* @param {String}  = [value:实例名] 
		*/
	this.dispose = (value) => {
		this.myChart.clear();
		this.myChart.dispose();
		this.dataOpt = [];
		this.coords = [];
		this.links = [];
		this.myChart = null;
		this.ele.firstElementChild.remove();
		//判断是否传了要销毁的实例
		if (!value) return;
		//垃圾回收机制
		window[value] ? window[value] = null : false;
	};
}

/**
 * 方法执行
 */
var chart = new jsGraphRule('.box');
chart.init(data);

/**
 * 自适应
 * 模拟系统自定义表格拖拽变化
 * 组件合并时去掉
 */
window.addEventListener('resize', () => {
	chart.resize();
})
